// src/pages/AdminDashboard.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  Paper,
  TextField,
  Button,
  Divider,
} from "@mui/material";

export default function AdminDashboard() {
  const [orders, setOrders] = useState([]);
  const [trackingMsgs, setTrackingMsgs] = useState({}); // Track messages per order

  // Fetch all orders
  const fetchOrders = async () => {
    try {
      const res = await axios.get("http://localhost:8080/api/orders/all");
      setOrders(res.data);
    } catch (err) {
      console.error("Failed to fetch orders:", err);
    }
  };

  useEffect(() => {
    fetchOrders();
  }, []);

  // Update order status
  const handleStatusUpdate = async (id, status) => {
    try {
      await axios.put(
        `http://localhost:8080/api/orders/status/${id}?status=${status}`
      );
      fetchOrders();
    } catch (err) {
      console.error("Failed to update status:", err);
    }
  };

  // Send tracking message
  const handleTrackingMsg = async (id) => {
    try {
      const msg = trackingMsgs[id] || "";
      await axios.put(
        `http://localhost:8080/api/orders/track/${id}?msg=${encodeURIComponent(
          msg
        )}`
      );
      alert("Tracking message sent!");
      fetchOrders();
    } catch (err) {
      console.error("Failed to send tracking message:", err);
    }
  };

  const handleInputChange = (id, value) => {
    setTrackingMsgs({ ...trackingMsgs, [id]: value });
  };

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h4" sx={{ mb: 3 }}>
        Admin Dashboard — All Orders
      </Typography>

      {orders.length === 0 && <Typography>No orders found.</Typography>}

      {orders.map((order) => (
        <Paper key={order.id} sx={{ p: 3, mb: 3 }}>
          <Typography variant="h6">
            <b>Order ID:</b> {order.id} | <b>User:</b> {order.userName}
          </Typography>
          <Typography>
            <b>Total:</b> ₹{order.totalPrice} | <b>Status:</b> {order.status}
          </Typography>
          <Typography>
            <b>Delivery Date:</b> {order.deliveryDate} | <b>Slot:</b>{" "}
            {order.deliverySlot}
          </Typography>

          <Divider sx={{ my: 2 }} />

          <Typography variant="subtitle1" sx={{ mb: 1 }}>
            Items:
          </Typography>
          {order.items?.map((item) => (
            <Paper key={item.id} sx={{ p: 1, mb: 1 }}>
              <Typography>
                <b>Product:</b> {item.product?.name}
              </Typography>
              {item.product?.imageUrl && (
                <img
                  src={item.product.imageUrl}
                  alt={item.product?.name}
                  style={{ width: 100, height: 100, objectFit: "cover" }}
                />
              )}
              <Typography>
                <b>Quantity:</b> {item.quantity} | <b>Price:</b> ₹
                {item.finalPrice}
              </Typography>
              <Typography>
                <b>Options:</b>{" "}
                {item.selectedOptions &&
                  JSON.stringify(JSON.parse(item.selectedOptions))}
              </Typography>
            </Paper>
          ))}

          <TextField
            label="Tracking Message"
            fullWidth
            multiline
            rows={2}
            sx={{ my: 2 }}
            value={trackingMsgs[order.id] || ""}
            onChange={(e) => handleInputChange(order.id, e.target.value)}
          />

          <Button
            variant="contained"
            sx={{ mr: 1 }}
            onClick={() => handleTrackingMsg(order.id)}
          >
            Send Tracking Message
          </Button>

          <Button
            variant="contained"
            color="success"
            onClick={() => handleStatusUpdate(order.id, "Delivered")}
          >
            Mark Delivered
          </Button>
        </Paper>
      ))}
    </Box>
  );
}
